import React from "react";
import Navbar from "./Navbar";
import Home from "./Home";
import About from "./About";
import Generate from "./Generate";
import background_img from "./images/background-img.jpg";

const App = () => {
  return (
    <>
      <img src={background_img} />
      <Navbar />
      <Home />
      {/* <About /> */}
      <Generate />
    </>
  );
};

export default App;
